--promjene za festivale za dobar unos iz mockaroo-a
ALTER TABLE Festivals
	RENAME COLUMN StartDate TO start_date;

ALTER TABLE Festivals
	ALTER COLUMN FestivalName TYPE VARCHAR(100),
	ALTER COLUMN City TYPE VARCHAR(100);


CREATE OR REPLACE FUNCTION Set_Festival_Status()
	RETURNS TRIGGER
AS
$$
	BEGIN
	IF(NEW.EndDate < CURRENT_DATE) THEN
		NEW.Status = 'completed';
	ELSIF(NEW.start_date > CURRENT_DATE) THEN
		NEW.Status = 'planned';
	ELSIF(NEW.start_date < CURRENT_DATE AND NEW.EndDate> CURRENT_DATE) THEN
		NEW.Status = 'active';
	END IF;
	RETURN NEW;
	END;
$$
language plpgsql;

CREATE TRIGGER Festival_Status
	BEFORE INSERT OR UPDATE ON Festivals
	FOR EACH ROW
	EXECUTE FUNCTION Set_Festival_Status();

--promjene za stages za dobar unos iz mockaroo-a
ALTER TABLE Stages
	ALTER COLUMN StageName TYPE VARCHAR(200),
	ADD CONSTRAINT unique_stage_per_festival
	UNIQUE (StageName, FestivalId);

--promjene za performances za dobar unos iz mockaroo-a
CREATE OR REPLACE FUNCTION Set_EndTime()
	RETURNS TRIGGER 
AS
$$
	BEGIN
    NEW.EndTime := NEW.StartTime + INTERVAL '2 hours';
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Trigger_Set_EndTime
	BEFORE INSERT ON Performances
	FOR EACH ROW
	EXECUTE FUNCTION Set_EndTime();

--promjene za tickets za dobar unos iz mockaroo-a
CREATE OR REPLACE FUNCTION If_Ticket_Has_Camp()
	RETURNS TRIGGER 
AS
$$
	BEGIN
	IF NEW.Type = 'Camp' THEN
		UPDATE Festivals 
		SET Camp = True
		WHERE FestivalId = NEW.FestivalId;
    END IF;
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Trigger_Festival_Has_Camp
	AFTER INSERT ON Tickets
	FOR EACH ROW
	EXECUTE FUNCTION If_Ticket_Has_Camp();

--promjene za WorkshopVisitor za dobar unos iz mockaroo-a
CREATE OR REPLACE FUNCTION Set_Valid_RegistrationTime()
	RETURNS TRIGGER 
AS
$$
	DECLARE 
		fest_id INT;
		fest_start TIMESTAMP;
		fest_end TIMESTAMP;
	BEGIN
	SELECT FestivalId INTO fest_id
	FROM WorkShop
	WHERE WorkshopId = NEW.WorkshopId;

	SELECT start_date, EndDate INTO fest_start, fest_end
	FROM Festivals
	WHERE festivalId = fest_id;
	IF New.RegistrationTime IS NULL THEN
    	NEW.RegistrationTime := fest_start;
	END IF;
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Valid_RegistrationTimee
	BEFORE INSERT ON WorkshopVisitor
	FOR EACH ROW
	EXECUTE FUNCTION Set_Valid_RegistrationTime();

CREATE OR REPLACE FUNCTION SkipDuplicatesWV()
	RETURNS TRIGGER 
AS
$$
	BEGIN
	IF EXISTS( 
		SELECT 1 FROM WorkShopVisitor
		WHERE WorkshopId = NEW.WorkshopId
		AND VisitorId = NEW.VisitorId
	)THEN
	RETURN NULL;
	END IF;
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Prevent_Duplicates
	BEFORE INSERT ON WorkshopVisitor
	FOR EACH ROW
	EXECUTE FUNCTION SkipDuplicatesWV();

--promjene za Purchase za dobar unos iz mockaroo-a
CREATE OR REPLACE FUNCTION Set_Valid_PurchaseMadeTime()
	RETURNS TRIGGER 
AS
$$
	DECLARE 
		fest_start TIMESTAMP;
		fest_end TIMESTAMP;
	BEGIN
	SELECT start_date, EndDate INTO fest_start, fest_end
	FROM Festivals
	WHERE festivalId = NEW.FestivalId;
	IF New.PurchaseMade IS NULL THEN
    	NEW.PurchaseMade := fest_start;
	END IF;
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Valid_PurchaseMadeTime
	BEFORE INSERT ON Purchase
	FOR EACH ROW
	EXECUTE FUNCTION Set_Valid_PurchaseMadeTime();

--promjene za Purchase za dobar unos iz mockaroo-a

CREATE OR REPLACE FUNCTION Set_Price()
	RETURNS TRIGGER 
AS
$$
	DECLARE
    	total FLOAT;
	BEGIN
    SELECT SUM((SELECT Price FROM Tickets WHERE TicketId = purticket.TicketId) * purticket.Quantity)
    INTO total
    FROM PurchaseTickets purticket
    WHERE purticket.PurchaseId = NEW.PurchaseId;

    UPDATE Purchase
    SET Price = total
    WHERE PurchaseId = NEW.PurchaseId;
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Set_Purchase_Price
	AFTER INSERT OR UPDATE ON PurchaseTickets
	FOR EACH ROW
	EXECUTE FUNCTION Set_Price();


CREATE OR REPLACE FUNCTION SkipDuplicatesPT()
	RETURNS TRIGGER 
AS
$$
	BEGIN
	IF EXISTS( 
		SELECT 1 FROM PurchaseTickets
		WHERE PurchaseId = NEW.PurchaseId
		AND TicketId = NEW.TicketId
	)THEN
	RETURN NULL;
	END IF;
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Prevent_Duplicates_Again
	BEFORE INSERT ON PurchaseTickets
	FOR EACH ROW
	EXECUTE FUNCTION SkipDuplicatesPT();	

