--promjene za Staff za dobar unos iz mockaroo-a

CREATE OR REPLACE FUNCTION Is_Valid_Security_Guard()
	RETURNS TRIGGER 
AS
$$
	BEGIN
	IF(NEW.Role = 'security guard') THEN
	NEW.HasSafetyTrainging := True;
	END IF;
    RETURN NEW;
	END;
$$ 
language plpgsql;

CREATE TRIGGER Check_Security_Guard
	BEFORE INSERT ON Staff
	FOR EACH ROW
	EXECUTE FUNCTION Is_Valid_Security_Guard(); 





	



















